attributes.description:
Требуется ЭЦП

Размещенные ниже поля предназначены для представления электронных копий документов, необходимых для предоставления услуги, а именно: 
-копия паспорта или заменяющего его документа; 
-копии документов, удостоверяющих личность членов семьи, а также документов, подтверждающих степень их родства с заявителем (свидетельства о рождении детей, заключении либо расторжении брака и другие); 
-ходатайство от предприятия, учреждения, организации, органа местного самоуправления Волгограда (их структурных подразделений), в котором работает (служит) заявитель (при его наличии);
-документ (или надлежащим образом заверенная копия), подтверждающий право заявителя на получение жилого помещения (справка с места работы (службы), пенсионное удостоверение, трудовая книжка, военный билет); 
-справка жилищно-эксплуатационной организации либо выписка из домовой книги о составе семьи; 
-копия правоустанавливающего документа на жилое помещение, в котором заявитель и члены его семьи проживают на момент подачи заявления; 
-сообщение Управления Федеральной службы государственной регистрации, кадастра и картографии по Волгоградской области об отсутствии (наличии) сведений о регистрации прав на недвижимое имущество на всех членов семьи заявителя;
медицинское заключение на каждого члена семьи заявителя о возможности проживания в общежитии.

